import React from 'react'

const Sresult = (props) => {

   const img = '';
   img = !empty(props.name) ? `https://source.unsplash.com/600x400?${props.name}` : null
   //img = `https://source.unsplash.com/600x400?${props.name}` 

   return (
       <>
          <div>
              <img src = { img } alt = "search"/>
          </div>
       </>
   )
}

export default Sresult
